import Button from "react-bootstrap/Button";

const Skills = () => {
  return (
    <div className="container">
      <table className="container">
        <tr>
          <Button variant="danger">Javascript</Button>
          <Button variant="info">Reactjs</Button>
          <Button variant="info">HTML</Button>
          <Button variant="info">CSS</Button>
          <Button variant="danger">GIT</Button>
          <Button variant="info">JSON</Button>
          <Button variant="info">SASS</Button>
          <Button variant="info">Github</Button>
          <Button variant="info">Bootstrap</Button>
          <Button variant="info">Responsive Design</Button>
        </tr>
      </table>
      <hr />
    </div>
  );
};

export default Skills;
